import collections
from typing import List


class Solution:
    def countSubarrays(self, nums: List[int], k: int) -> int:
        res = 0
        n = len(nums)
        _max = max(nums)
        left = 0
        count = 0
        for i in range(n):
            if nums[i] == _max:
                count += 1
            while count >= k:
                if nums[left] == _max:
                    count-=1
                left+=1
            res += left
        return res
    def countSubarrays2(self, nums: List[int], k: int) -> int:
        # 初始化一些参数
        res = 0
        n = len(nums)
        _max = max(nums)
        # 剪枝退出
        if nums.count(_max) < k:
            return 0
        # 我们只关心max值和他出现的次数，因此可以把max置为1其它置为0
        # e.g. [1,3,2,3,3] --> [0,1,0,1,1] （k=2）
        # 考虑一下此时的答案如何获取，我们需要凑两个以上的1，这里可以想到前缀和
        nums = [max(0,nums[i]-_max+1) for i in range(n)]

        # 接下来做前缀和，可以得到
        # e.g. [0,1,0,1,1] --> [0,0,1,1,2,3]
        # 考虑此时的答案，当出现大于k的数字时，需要往前找到num-k的位置
        # e.g. 考虑前缀和的2可以构成的答案，[3,2,3]，[1,3,2,3]
        # e.g. 考虑前缀和的3可以构成的答案，[1,3,2,3,3]，[3,2,3,3],[2,3,3]，[3,3]
        # 可以发现，记pre中的数字为num，当num>=k时，只需要找到num-k的最右侧位置即可。
        # 对应上述例子，2-2=0的索引为1，res += 2*count(2)；3-2=1的索引为3，res += 4*count(4)
        # 综上所述，需要构造前缀和pre、索引最右侧出现位置dic1、计数字典dic2

        # 前缀和数组 pre
        pre = [0]
        for i in range(n):
            pre.append(pre[-1]+nums[i])
        # 索引最右侧出现位置dic1、计数字典dic2
        dic2 = collections.Counter(pre)
        dic1 = {0:dic2[0]}
        for d in dic2:
            if d > 0:
                dic1[d] = dic1[d-1]+dic2[d]
        print(pre)
        print(dic1)
        print(dic2)
        # nums = [1,3,2,3,3], k = 2
        # pre [0, 0, 1, 1, 2, 3]
        # dic1 {0: 2, 1: 4, 2: 5, 3: 6}
        # dic2 {0: 2, 1: 2, 2: 1, 3: 1}
        # res = dic1[2-2]*dic2[2] + dic[3-2]*dic2[3] = 1 * 2 + 1 * 4 = 6
        for d in dic1:
            if d >= k:
                res += dic1[d-k] * dic2[d]
        return res
